// Import
import React from "react";

// Functional Component
const ErrorPage = () => {
    return (
        <div className="error-page">
            <img className="error-image" src="https://freesvg.org/img/car-crash-clipart-publicdomain.png" alt="Error"/>
            <h1 className="error-message">We apologize for the inconvenience, please try again later or contact our customer service team for assistance.</h1>
        </div>
    )
};

// Export
export default ErrorPage;

// Rememeber IDs(#) are more specific than Classes(.)
